import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;
import static org.mockito.Mockito.*;
import static org.mockito.ArgumentMatchers.*;
import org.springframework.data.domain.Page;
import org.springframework.data.domain.PageRequest;
import org.springframework.data.domain.Pageable;
import org.springframework.samples.petclinic.owner.PetTypeFormatter;
import java.util.Locale;
import static org.junit.jupiter.api.Assertions.*;
import org.springframework.samples.petclinic.owner.PetType;
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertThrows;
import java.util.Locale;
import java.util.List;
import static org.mockito.Mockito.when;
import org.springframework.samples.petclinic.owner.PetType;
import java.text.ParseException;
import static org.junit.jupiter.api.Assertions.assertEquals;

@ExtendWith(MockitoExtension.class)
class PetTypeFormatterTest {

	@Mock
	private PetTypeRepository types;

	@InjectMocks
	private PetTypeFormatter controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Returns the name of the pet type when it has a non-null name")
	void testPrintReturnsPetTypeNameWhenNameIsNotNull() {
		PetType petType = new PetType();
		petType.setName("Cat");
		var result = controller.print(petType, Locale.ENGLISH);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Returns '<null>' when the pet type name is null")
	void testPrintReturnsNullStringWhenNameIsNull() {
		PetType petType = new PetType();
		petType.setName(null);
		var result = controller.print(petType, Locale.ENGLISH);
		assertEquals("<null>", result);
	}

	@Test
	@DisplayName("Returns an empty string when the pet type name is an empty string")
	void testPrintReturnsPetTypeNameWhenNameIsEmptyString() {
		PetType petType = new PetType();
		petType.setName("");
		var result = controller.print(petType, Locale.ENGLISH);
		assertEquals("", result);
	}

	@Test
	@DisplayName("Throws NullPointerException when petType is null")
	void testPrintThrowsNullPointerExceptionWhenPetTypeIsNull() {
		assertThrows(NullPointerException.class, () -> {
			instance.print(null, Locale.ENGLISH);
		});
	}

	@Test
	@DisplayName("Verifies that parse returns the correct PetType when the input text matches a pet type name in the collection")
	void testParseReturnsPetTypeWhenNameMatches() {
		PetType dogType = new PetType();
		dogType.setName("Dog");
		PetType catType = new PetType();
		catType.setName("Cat");
		when(types.findPetTypes()).thenReturn(List.of(dogType, catType));
		var result = controller.parse("Dog", Locale.ENGLISH);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that parse throws ParseException when the input text does not match any pet type name")
	void testParseThrowsParseExceptionWhenNameNotFound() {
		PetType dogType = new PetType();
		dogType.setName("Dog");
		PetType catType = new PetType();
		catType.setName("Cat");
		when(types.findPetTypes()).thenReturn(List.of(dogType, catType));
		assertThrows(ParseException.class, () -> {
			controller.parse("Bird", Locale.ENGLISH);
		});
	}

	@Test
	@DisplayName("Verifies that parse returns the correct PetType when there are multiple types and a match is found")
	void testParseReturnsPetTypeWhenMultipleTypesAndMatchFound() {
		PetType dogType = new PetType();
		dogType.setName("Dog");
		PetType catType = new PetType();
		catType.setName("Cat");
		PetType birdType = new PetType();
		birdType.setName("Bird");
		when(types.findPetTypes()).thenReturn(List.of(dogType, catType, birdType));
		var result = controller.parse("Cat", Locale.FRENCH);
		assertNotNull(result);
	}

}
